import React from "react";
import Header from "../layouts/Header";

const ProductPage = () => {
    return (

        <>
            <Header />
            <main className="p-8">
                <h1 className="text-3xl mt-4 mb-5">Add New Product</h1>
                <form action="">
                    <div className="form-group">
                        <label htmlFor="name">Product Name <b className="text-red-500">*</b></label>
                        <input type="text" className="mt-1 w-full border-[1px] border-gray-300 p-3 rounded-lg outline-sky-900" placeholder="Name" id="name" />
                    </div>

                    <div className="flex items-center justify-end mt-5">
                        <button className="bg-blue-800 text-white py-2 px-3 rounded">
                            <span class="material-symbols-outlined">
                                add
                            </span>
                            Add New</button>
                    </div>
                </form>
            </main>
        </>
    )
};

export default ProductPage;
